/*Table structure for table `yii2cmf_comment` */

DROP TABLE IF EXISTS `yii2cmf_comment`;

CREATE TABLE `yii2cmf_comment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `type_id` int(11) NOT NULL,
  `content` text COLLATE utf8_unicode_ci NOT NULL COMMENT '内容',
  `parent_id` int(11) NOT NULL DEFAULT '0',
  `up` int(1) NOT NULL DEFAULT '0',
  `down` int(1) NOT NULL DEFAULT '0',
  `is_top` smallint(1) NOT NULL DEFAULT '0',
  `type` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `created_at` int(10) NOT NULL,
  `updated_at` int(10) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `type` (`type`,`type_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `yii2cmf_comment` */

/*Table structure for table `yii2cmf_company_biz_address` */

DROP TABLE IF EXISTS `yii2cmf_company_biz_address`;

CREATE TABLE `yii2cmf_company_biz_address` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自动增长ID',
  `company_id` int(11) NOT NULL COMMENT '用户user_id',
  `address` varchar(100) DEFAULT NULL COMMENT '场所地址',
  `modality` smallint(2) DEFAULT NULL COMMENT '所属形式（1：自有 2：租赁 3:市场内经营）',
  `area` smallint(6) DEFAULT NULL COMMENT '面积',
  `start_time` int(11) DEFAULT NULL COMMENT '开始时间',
  `end_time` int(11) DEFAULT NULL COMMENT '结束时间',
  `coordinate_x` varchar(20) DEFAULT NULL COMMENT '坐标X',
  `coordinate_y` varchar(20) DEFAULT NULL COMMENT '坐标Y',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `attachment_num` tinyint(5) DEFAULT NULL COMMENT '附件数',
  `order` int(11) DEFAULT NULL COMMENT '排序',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态（1：正常 0：删除）',
  `created_at` int(11) DEFAULT NULL COMMENT '创建时间',
  `updated_at` int(11) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `index_user_id` (`company_id`) USING BTREE
