/*Table structure for table `yii2cmf_company_other_loan` */

DROP TABLE IF EXISTS `yii2cmf_company_other_loan`;

CREATE TABLE `yii2cmf_company_other_loan` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自动增长ID',
  `company_id` int(11) NOT NULL COMMENT '用户id',
  `lender` varchar(20) DEFAULT NULL COMMENT '贷款人',
  `loan_num` bigint(30) DEFAULT '0' COMMENT '贷款数量',
  `loan_remainder` bigint(30) DEFAULT '0' COMMENT '贷款余额',
  `loan_start_time` int(11) DEFAULT NULL COMMENT '贷款开始时间',
  `loan_end_time` int(11) DEFAULT NULL COMMENT '贷款结束时间',
  `loan_type_id` int(30) DEFAULT NULL COMMENT '贷款类型',
  `overdue_num` int(5) DEFAULT '0' COMMENT '逾期次数',
  `loan_bank` varchar(30) DEFAULT NULL COMMENT '贷款机构',
  `type` smallint(2) DEFAULT NULL COMMENT '借贷征信类型（1：企业，2：个人）',
  `is_sued` tinyint(4) DEFAULT NULL COMMENT '是否涉诉',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `attachment_num` smallint(5) DEFAULT NULL COMMENT '附件个数',
  `order` int(11) DEFAULT NULL COMMENT '排序',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态（0：删除 1：正常）',
  `created_at` int(11) DEFAULT NULL COMMENT '创建时间',
  `updated_at` int(11) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `index_user_id` (`company_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='企业贷款表';

