/*Table structure for table `yii2cmf_company_profile` */

DROP TABLE IF EXISTS `yii2cmf_company_profile`;

CREATE TABLE `yii2cmf_company_profile` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自动增长ID',
  `customer_id` int(11) NOT NULL COMMENT '借款id',
  `person_id` int(11) DEFAULT NULL COMMENT '所属借款人id',
  `name` varchar(50) DEFAULT NULL COMMENT '企业别名（全名）',
  `nick_name` varchar(100) NOT NULL COMMENT '企业名称（别名和简称）',
  `group_name` varchar(100) DEFAULT NULL COMMENT '所属集团名称',
  `actual_controller` varchar(50) DEFAULT NULL COMMENT '实际控制人',
  `actual_controller_idno` varchar(50) DEFAULT NULL COMMENT '实际控制人身份证',
  `actual_controller_mobile` varchar(50) DEFAULT NULL COMMENT '实际控制人电话',
  `contact` varchar(50) DEFAULT NULL COMMENT '联系人',
  `contact_mobile` varchar(50) DEFAULT NULL COMMENT '联系人电话',
  `contact_web_type` varchar(50) DEFAULT NULL COMMENT '联系人其它联系方式',
  `tradind_market` varchar(50) DEFAULT NULL COMMENT '所在区域(所在交易市场)',
  `telephone` varchar(11) DEFAULT NULL COMMENT '公司电话',
  `registration_time` int(11) DEFAULT NULL COMMENT '注册时间',
  `operation_time` int(11) DEFAULT NULL COMMENT '实际运营时间',
  `registered_address` varchar(200) DEFAULT NULL COMMENT '注册地址',
  `office_address` varchar(200) DEFAULT NULL COMMENT '办公地址',
  `registered_capital` int(11) DEFAULT NULL COMMENT '注册资本',
  `property` varchar(20) DEFAULT NULL COMMENT '企业性质',
  `company_type_id` int(11) DEFAULT NULL COMMENT '公司类型（JJ:经纪公司/GT:个体经营/4S:4S店/ZH:综合经销商/XX:信息员专用/PT:平台/QT:其他）',
  `business_place_type_id` int(11) DEFAULT NULL COMMENT '经营场所性质，ZL-展厅租赁 ZY-展厅自有 SC-市场内经营',
  `business_licence_no` varchar(20) DEFAULT NULL COMMENT '营业执照号',
  `organization_code` varchar(30) DEFAULT NULL COMMENT '组织机构代码',
  `employee_count_id` int(11) DEFAULT NULL COMMENT '员工人数',
  `main_business` varchar(500) DEFAULT NULL COMMENT '主营业务',
  `business_start_time` int(11) DEFAULT NULL COMMENT '营业期限开始时间',
  `business_end_time` int(11) DEFAULT NULL COMMENT '营业期限结束时间',
  `owned_industry` varchar(50) DEFAULT NULL COMMENT '所属行业',
  `customer_source` varchar(100) DEFAULT NULL COMMENT '客户来源',
  `status` tinyint(4) DEFAULT '1' COMMENT '状态（0：删除 1：正常）',
  `description` text COMMENT '企业介绍',
  `province_id` int(11) DEFAULT NULL COMMENT '省份ID',
  `city_id` int(11) DEFAULT NULL COMMENT '城市ID',
  `area_id` int(11) DEFAULT NULL COMMENT '地区ID',
  `longitude` varchar(50) DEFAULT NULL COMMENT '地址的经度',
  `latitude` varchar(50) DEFAULT NULL COMMENT '地址的纬度',
  `manager_id` int(11) DEFAULT NULL COMMENT '客户经理ID（业务员ID）',
  `store_area` decimal(10,2) DEFAULT NULL COMMENT '门店面积（㎡）',
  `created_by` int(11) DEFAULT NULL COMMENT '操作人ID',
  `updated_at` int(11) DEFAULT NULL COMMENT '更新时间',
  `created_at` int(11) NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `index_user_id` (`customer_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=50 DEFAULT CHARSET=utf8 COMMENT='企业基本信息主表';

