中心。5年来MMCAR积累客户超过三万余人，已经成为广东省顶级的大型二手车经销商，一个让消费者认可的二手车消费品牌。这是迈卡易人最引以为豪的成就！【服务】※MMCAR认证车均经过八大类238道工序的严格检测评估，向客户提供“七天包退”“三个月无忧换车”“实惠一口价销售”“求车易”“两年不限公里4S保修”等服务。其中“两年不限公里4S保修”是广东省唯一有资质提供这项服务的经销商；MMCAR以过硬的技术水平，现代化设备、规范化服务、最优惠的价格带给客户最贴心、优质的服务。【荣耀】※《车天车地车世界》电台节目特邀嘉宾。※《极速车坛》电视节目合作伙伴※广州市汽业流通协会黄标车报废项目，协会指定的、唯一的二手车商合作单位。※接受过易车网、第一车网、南方都市报、电台、电视台等各大平台与媒体的专访。※MMCAR获奖无数：2013/11/23全国首家美国上市汽车专业网站易车网颁发“全国二手车专业公司20强”;2013/12/15广州汽车服务业协会颁发“诚信二手车经销商奖”;2014/02/25第一车网颁发“客户满意奖”；2014/03/15广东省汽车流通协会颁发“诚信二手车商户”；2014/06/1258同城颁发“中国好商家”称号；2015/01/01赢得首届二手车鉴定评估师擂台赛并接受《府前直通车》广州电视台节目采访。【地址与联系方式】※MMCAR总部设于广州市天河区黄埔大道西赛马场汽车城北区22号。电话：020-62236228※旗舰店位于：佛山市南海区海八路车城G11-1号（麦当劳旁），电话：0757-81068389※400热线：400-9911-777，网址：www.mmcar.com.cn,官',20,190,NULL,NULL,NULL,NULL,NULL,103,1469525317,1469524807),(4,4,NULL,'东莞展鹏二手车','东莞展鹏二手车','',NULL,NULL,NULL,NULL,NULL,NULL,'','13712705592',1255881600,1255881600,'','寮步富竹山联合二手车交易市场',100,'66',NULL,NULL,'441900000658929','441900000658929',NULL,'7',1255881600,-1,'10','',1,'好',20,188,NULL,'','',NULL,'200.00',102,1471401158,1469604017),(5,5,NULL,'奔宝二手车有限公司','奔宝二手车有限公司','',NULL,NULL,NULL,NULL,NULL,NULL,'','15989929793',1396454400,1108742400,'','东莞市寮步镇寮城中路霞边端段29-38号',200,'66',NULL,NULL,'441900002413025','441900002413025',10,'7',1427990400,-1,'10','转介绍，广告宣传',1,'好',20,188,NULL,'113.891662','22.988758',NULL,'1200.00',102,1471246566,1469690956),(6,7,NULL,'沈阳车巢二手车旗舰店','沈阳车巢二手车旗舰店','',NULL,NULL,NULL,NULL,NULL,NULL,'','18302424333',1453737600,1330617600,'大东区长安路41号2-7-2','沈阳市铁西区保工街北二路',100,'66',NULL,NULL,'91240104MA0P4BT22W','G1021010403804480H',20,'7',1453737600,-1,'10','朋友/转介绍/网络/自然进店/置换',1,'车巢二手车展区座落于铁西区保工街北二路黄金地段，本公司共有车辆展位200余个，地上50个展位，地下150个展位，公司具有专业评估师团队以及强大的销售团队，铭金汇二手车竭诚为您买卖二手车保驾护航!铭金汇二手车承诺本公司无事故车，水泡车，及火烧车。在铭金汇二手车购买车辆还可享受一年或2万公里质量保证，铭金汇二手车还可以为您提供多元化的金融贷款方案，为您量身定制二手车金融信贷服务和保险产品。铭金汇二手车期待您的光临！',8,198,NULL,'123.365922','41.810558',NULL,'1000.00',108,1470813627,1470813627),(7,8,NULL,'东莞市大得通实业投资有限公司','东莞市大得通实业投资有限公司','',NULL,NULL,NULL,NULL,NULL,NULL,'','13829205556',1442160000,136733760