/*Table structure for table `yii2cmf_company_relation_company` */

DROP TABLE IF EXISTS `yii2cmf_company_relation_company`;

CREATE TABLE `yii2cmf_company_relation_company` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自动增长ID',
  `company_id` int(11) DEFAULT NULL COMMENT '企业ID',
  `company_name` varchar(100) NOT NULL COMMENT '关联企业名称',
  `rela_form` varchar(50) DEFAULT NULL COMMENT '关联形式',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注说明',
  `attachment_num` tinyint(5) DEFAULT NULL COMMENT '附件个数',
  `order` int(11) DEFAULT NULL COMMENT '排序',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态',
  `created_at` int(11) DEFAULT NULL COMMENT '创建时间',
  `updated_at` int(11) DEFAULT NULL COMMENT '更新时间',
  `rela_customer_id` int(11) DEFAULT NULL COMMENT '关联企业ID',
  PRIMARY KEY (`id`),
  UNIQUE KEY `company_id` (`company_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='企业关联公司表';

