/*Table structure for table `yii2cmf_customer` */

DROP TABLE IF EXISTS `yii2cmf_customer`;

CREATE TABLE `yii2cmf_customer` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自动增长ID',
  `code` varchar(50) DEFAULT NULL COMMENT '客户代码',
  `class` int(11) DEFAULT NULL COMMENT '10 个人  20 企业',
  `name` varchar(200) DEFAULT NULL COMMENT '个人名称/企业名称',
  `company_name` varchar(200) DEFAULT NULL COMMENT '企业名称',
  `link_name` varchar(20) NOT NULL DEFAULT '' COMMENT '别名/简称',
  `card_number` char(20) DEFAULT '' COMMENT '身份证号/企业号',
  `card_address` varchar(40) DEFAULT '' COMMENT '户籍所在地/登记所在地',
  `province_id` int(11) DEFAULT NULL COMMENT '省份ID',
  `city_id` int(11) DEFAULT NULL COMMENT '城市ID',
  `city_proper_id` int(11) DEFAULT NULL COMMENT '地区ID',
  `address` varchar(40) DEFAULT '' COMMENT '现住址（等同于经营地址）',
  `email` varchar(40) DEFAULT '' COMMENT '邮箱',
  `mobile` varchar(20) DEFAULT '' COMMENT '联系电话',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态 1:正常 0:删除',
  `src_id` int(20) DEFAULT '0' COMMENT '信息来源ID',
  `manager_id` int(11) DEFAULT NULL COMMENT '客户经理ID',
  `description` text COMMENT '个户情况介绍',
  `remarks` text COMMENT '客户说明',
  `created_at` int(11) DEFAULT '0' COMMENT '创建时间',
  `updated_at` int(11) DEFAULT '0' COMMENT '更新时间',
  `created_by` int(11) DEFAULT NULL COMMENT '后台管理员|业务员',
  `updated_by` int(11) DEFAULT NULL COMMENT '更新人员',
  `block_at` int(11) DEFAULT NULL COMMENT '冻结日期',
  `confirmed_at` int(11) DEFAULT NULL COMMENT '审核日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=60 DEFAULT CHARSET=utf8 COMMENT='借款人表';

