/*Table structure for table `yii2cmf_person_work` */

DROP TABLE IF EXISTS `yii2cmf_person_work`;

CREATE TABLE `yii2cmf_person_work` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自动增长ID',
  `person_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `start_time` int(11) NOT NULL DEFAULT '0' COMMENT '开始时间',
  `end_time` varchar(11) NOT NULL DEFAULT '0' COMMENT '结束时间',
  `company` varchar(20) DEFAULT '' COMMENT '工作单位',
  `position` varchar(10) DEFAULT '' COMMENT '岗位',
  `phone` varchar(20) DEFAULT '' COMMENT '电话',
  `detail` varchar(500) DEFAULT '' COMMENT '工作说明',
  `attachment_num` int(11) NOT NULL COMMENT '附件数量',
  `status` tinyint(2) DEFAULT '1' COMMENT '状态 1:正常 0:删除',
  `order` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `created_at` int(11) DEFAULT '0' COMMENT '创建时间',
  `updated_at` int(11) DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`person_id`),
  KEY `start_time_user_id` (`person_id`,`start_time`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='用户工作简历表';

