  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '标识',
  `title` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '名称',
  `domain` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '域名',
  `page_dom` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '分页链接元素',
  `list_dom` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '列表链接元素',
  `time_dom` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '内容页时间元素',
  `content_dom` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '内容页内容元素',
  `title_dom` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '内容页标题元素',
  `target_category` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '目标分类',
